 déclinées dans les 7 couleurs soit 140 figurines au total, je les trouve mieux faites que les monochromes ESSO, et on peut également apprécier la diversité des personnages, certains rares ou même inédits en figurine plastique :\r\nTintin, Milou, Haddock, Tournesol, Nestor, Dupondt, Castafiore, Allan, Rastapopoulos, Abdallah, emir ben Kalish Ezab, Oliveira da figueira, Wang Jen-Ghié, fakir cigares du pharaon, Philémon Siclone, colonel cigares du pharaon, Zorrino, Rackham le Rouge'),(75,'STENVAL JAUNE',1971,NULL,'Cette série STENVAL était offerte en 1971 dans les produits laitiers du même nom.\r\nD\'environ 3cm, elles sont marquées Stenval © Lombard et TITO dans un losange au dos.\r\nElle représente 20 personnages des aventures de Tintin.','Offert en 1971, 20 figurines représentant divers personnages de la série Tintin (marqué au dos \"Stenval-Lombard\" d\'environ 3 cm de haut)\r\nAttention aux rééditions de 1992 Colombiennes (marqué \"inteco Pinateria\") mais quand même super interessante car environ une quinzaine de figurine supplémentaires et différentes par rapport à celles distribuées en France !\r\nmarque pininteria intenco tres tres rare de 1992,c est une reedition de la marque stenval.\r\nhttp://tin-7.soforums.com/t121-collection-figurines-STENVAL.htm\r\nCette série STENVAL était offerte en 1971 dans les produits laitiers du même nom.\r\nCe sont des figurines de 2-3 cm en plastique, monochromes, existantes dans 7 couleurs différentes : Blanc, Bleu, Jaune, Mauve, Orange, Rouge et Vert. au dos on peut lire : Stenval © Lombard. \r\nil existe 20 figurines différentes déclinées dans les 7 couleurs soit 140 figurines au total, je les trouve mieux faites que les monochromes ESSO, et on peut également apprécier la diversité des personnages, certains rares ou même inédits en figurine plastique :\r\nTintin, Milou, Haddock, Tournesol, Nestor, Dupondt, Castafiore, Allan, Rastapopoulos, Abdallah, emir ben Kalish Ezab, Oliveira da figueira, Wang Jen-Ghié, fakir cigares du 