7 couleurs soit 140 figurines au total, je les trouve mieux faites que les monochromes ESSO, et on peut également apprécier la diversité des personnages, certains rares ou même inédits en figurine plastique :\r\nTintin, Milou, Haddock, Tournesol, Nestor, Dupondt, Castafiore, Allan, Rastapopoulos, Abdallah, emir ben Kalish Ezab, Oliveira da figueira, Wang Jen-Ghié, fakir cigares du pharaon, Philémon Siclone, colonel cigares du pharaon, Zorrino, Rackham le Rouge'),(80,'PC - PLASTOY 1994',1994,NULL,'Cette série comprends les mêmes personnages que l\'édition figurine.\r\nLes figurines étaient vendues autour de 28francs soit aujourd\'hui environ 6€.',''),(81,'Carte de Voeux 1972',2019,NULL,'','Serie Moulinsart 2019\r\nEnviron 6 cm\r\nAlliage métal 1000ex de chaque avec cerytif numéroté'),(82,'PC - ML 2003',2003,NULL,'Porte clefs de figurines éditées la même année',''),(83,'Willeb',NULL,NULL,'',''),(84,'JIM',1960,0,'Cette série de 1965 comprend 6 personnages et 2 porte-clefs. Les figurines sont en acétates de cellulose et peintes à la main par des travailleur à domicile, mais encore plus souvent par des prisonniers de droit commun. Elles étaient vendues au détail ou dans une boîte cartonnée représentant un théatre ( avec seulement Milou assis). Le marquage est  : ©Dargaud JIM qui se trouve dans un losange gravé sous les pieds des personnages. Par contre, Milou qui est trop petit est marqué par \"Dargaud\".','La composition de base était de l\'acétate de cellulose, et elles sortaient du moule dans un sale blanc cassé. Après elles étaient peintes par des travailleur à domicile, mais encore plus souvent par des prisonniers de droit commun. C\'était le bon temps ou les détenus pouvaient se faire un peu d\'argent de poche en suivant la principe de \" Le travail c\'est la santé \".\r\nLes prix pratiqués actuellement sont prohibitifs. Il faut compter près de 500€ pour une série complète ( sans les porte-clefs)\r\nHaddock 6 cm dargaud inscrit dans le dos\r\ndans cette série il y a deux milous mais visiblement un seul Dupondt\r\n\r\nhttp://tintinde7a77ans.free.fr/?Jim-1960\r\n\r\nDescription : 6 personnages en plastique rigide. Elles sont peintes à la main. Vendues au détail ou dans une boîte cartonnée représentant un théatre où Milou était présent.\r\nTintin et Haddock existent en porte-clés dans deux modèles différents (taille).\r\n Tintin en porte clé : Normallement, Milou est collé avec son maître Tintin mais, il est souvent manquant. \r\n Haddock : Le capitaine est représenté dans la dernière version avec un perroquet rouge sur l’épaule. (Faites attention il existe une autre marque de figurine représentant Haddock avec le perroquet donc vérifiez le marquages). Les personnages : Tintin, Milou assis, Milou marchant, Tournesol, Haddock, et un Dupont(d).\r\nMarquages : ©Dargaud JIM se trouve dans un losange gravé sous les pieds des personnages. Par contre, Milou qui est trop petit est marqué par \"Dargaud\".\r\nPrix moyen : 50€ à 80€ pièce. La série peut atteindre 400 à 500€.'),(85,'PC - BULLY',1990,NULL,'Cette série comporte la marque BULLY sous le pieds des figurines',''),(86,'PC - BULLY MADE IN GERMANY',1990,NULL,'Cette série comporte la marque BULLY sous le pieds des figurines et Made in Germany dans le dos',''),(87,'PC - BULLY PIB',1977,NULL,'Cette série est appelée BULLY PIB, à cause de l\'inscription ©PIB dans le dos de chaque figurine.',''),(88,'PC - COMICS SPAIN',1985,NULL,'Cette série de porte-clefs commandée par les Editions du Lombard porte le nom du fabriquant Espagnol.',''),(89,'ML 2015',2015,0,'',''),(90,'ML 2011 Grand',2011,NULL,'Cette série existe aussi en petit modèle',''),(91,'ML 2012 Grand',2012,NULL,'Cette série existe aussi en petit modèle',''),(92,'La Collection Officielle',2011,0,'Série en résine pour grand public qui compte le plus de figurines différentes. (111)\r\nLa série fut entièrement réédité quelques années plus tard sous le nom : Collection Résine.\r\nLa première édition n\'avait pas de référence. Mais le détail de la figurine était inscrit sous le socle. Tandis la seconde édition a un tampon Moulinsart.',''),(93,'La Collection Officielle - Hors Série',2011,0,'La série fut entièrement réédité quelques années plus tard sous le nom : Collection Résine.',''),(94,'ML 2015 Petit',2015,NULL,'Cette série existe aussi en grand modèle',''),(95,'Mini Buste',2017,NULL,'Série sortie en 2017.\r\nExiste aussi en porte-clefs',''),(98,'EX.IN.CO',1950,0,'Figurines de 12 cm fabriquées entre 1950 et 1966 dans une mousse de latex armée animable. Cette mousse contenait une armature en fil de fer. La mousse supporte mal le temps et le sec et les figurines en très bon état sont très rares. Seules celles conservées dans les sachets en plastique d\'origine sont en bon état.\r\nLe prix varie de 50 à 250€ suivant l\'état.',''),(99,'PC - ML 2012 Grand',2012,0,'',''),(100,'PC - ML 2012 Petit',2012,0,'',''),(101,'United Labels',2011,0,'Pour la sortie du film de Spielberg, United Labels sort un jeu de société type \'Petits Chevaux\' qui comprends les 4 fois les 4 figurines présentées',''),(102,'SERI',1986,0,'Séries de poupées fabriquées en Chine for SERI\r\nSous licence Hergé - Editions du Lombard : 39274',''),(103,'The Adventures of Tintin',2011,0,'',''),(104,'Quaker Oats',1966,0,'En 1966, Quaker Oats produit les Céréales P\'tis Trésors Tintin.\r\nDans cette boite de ce céréales, on y trouve Tintin ou Milou',''),(106,'Mascottes Cesar',1962,0,'Ensemble de 6 figures thermoformées.\r\nCes mascottes avaient vocation à être accrochées sur un mur. \r\nFabrication des atelier César vers 1962.',''),(107,'Collection Courant d\'air',2009,0,'Cette série ne comprends qu\'un objet. :-)',''),(108,'DELACOSTE 1968',1968,0,'Pas d\'informations sur cette série',''),(109,'OLA Jaune',1969,0,'Les figurines étaient offertes avec les pots de glace OLA. 7 couleurs : jaune, bleu, blanc, vert, orange ou rouge. L’inscription au dos est © LOMBARD TITO Série réédité 2 ans plus tard par Stenval en France.',''),(110,'Mini Bustes - PC',2017,0,'Série sortie en 2017.','');
